import './App.css';
import { useState } from 'react'
import Sidebar from './components/Sidebar'
import Deshboard from './components/Deshboard'
import AllStudents from './components/AllStudents'
import AddStudents from './components/AddStudents'
import {BrowserRouter , Route, Routes} from 'react-router-dom'

function App() {
  let data = {
    Earnings:"40,000",
    Annual:"2,40,000",
    Tasks:20,
    Pending:26
  };

  let [student, setStudents] = useState([
    {
      name:"kiran",
      email:"kiran@gmail.com",
      mobile:"42345245",
      class :"b30wd"
    },
    {
      name:"raj",
      email:"kiran@gmail.com",
      mobile:"423452454",
      class :"b30wd"
    },
    {
      name:"hemnt",
      email:"kiran@gmail.com",
      mobile:"465445345245",
      class :"b30wd"
    }
  ])
  return ( 
      <BrowserRouter>
        <div style={{display:"grid",gridTemplateColumns:"15% 85%"}}>
          <div>
            <Sidebar/>
          </div>
          <div>
            <Routes>
              <Route path="/deshboard" element={<Deshboard data= {data}/>}/>
              <Route path="/all-students" element={<AllStudents data= {{student,setStudents}}/>}/>
              <Route path="/add-students" element={<AddStudents data= {student}/>}/>
              <Route path="/" element={<Deshboard data= {data}/>}/>
            </Routes>
          </div>
        </div>
      </BrowserRouter> 
  );
}

export default App;
